import React, { Component } from 'react';
import songs from './songs';
import FlipMove from 'react-flip-move'

const items = songs.items
class Songlist extends Component {
    render() {
        return (
            <div>
                {
                    items.map((item, i) => {
                        return (<FlipMove>
                            <div key={i}>
                                <h5>{item.album.name}</h5>
                            </div>
                        </FlipMove>)
                    }
                    )
                }
            </div>


        );
    }
}
export default Songlist;
